import React from 'react';
import { View, Text, Image, TouchableOpacity } from 'react-native';

function Home() {
	return (
		<View style={{ backgroundColor: 'white', flex: 1 }}>
			<View style={{ justifyContent: 'center', alignItems: 'center' }}>
				<Image
					source={require(`../assets/logo.png`)}
					style={{ width: 320, height: 150, borderWidth: 2, borderColor: 'red' }}
				/>
			</View>
			<View style={{ justifyContent: 'center', alignItems: 'center' }}>
				<TouchableOpacity>
					<View
						style={{
							alignItems: 'center',
							justifyContent: 'center',
							backgroundColor: '#1cd777',
							borderRadius: '8px',
							width: 200,
							height: 80
						}}
					>
						<Text style={{ color: 'white', fontWeight: 'bold' }}>دکمه</Text>
					</View>
				</TouchableOpacity>
			</View>
		</View>
	);
}

export default Home;
